import React, { useState } from 'react';
import { Link, useLocation } from 'react-router-dom';
import { Search, ShoppingBag, Heart, Menu, X, ChevronDown, User, LogOut } from 'lucide-react';
import { useApp } from '../context/AppContext';
import Footer from './Footer';

const Layout = ({ children }) => {
  const [isMobileMenuOpen, setIsMobileMenuOpen] = useState(false);
  const [searchQuery, setSearchQuery] = useState('');
  const [showShopDropdown, setShowShopDropdown] = useState(false);
  const [showAuthDropdown, setShowAuthDropdown] = useState(false);
  const { cartItemsCount, setSearchQuery: setGlobalSearchQuery, user, setUser } = useApp();
  const location = useLocation();

  const handleSearch = (e) => {
    e.preventDefault();
    setGlobalSearchQuery(searchQuery);
    // In a real app, you would navigate to search results
    console.log('Searching for:', searchQuery);
  };

  const toggleMobileMenu = () => {
    setIsMobileMenuOpen(!isMobileMenuOpen);
  };

  const handleSignOut = () => {
    setUser(null);
    setShowAuthDropdown(false);
  };

  const navLinks = [
    { name: 'Home', path: '/' },
    { name: 'About', path: '/about' },
    { 
      name: 'Shop', 
      path: '#',
      hasDropdown: true,
      dropdownItems: [
        { name: 'Collection', path: '/collection' },
        { 
          name: 'Category', 
          path: '#',
          hasSubmenu: true,
          submenuItems: [
            { name: 'Men', path: '/shop/men' },
            { name: 'Women', path: '/shop/women' }
          ]
        }
      ]
    },
    { name: 'Community', path: '/community' },
    { name: 'Sustainability', path: '/sustainability' },
    { name: 'Contact', path: '/contact' }
  ];

  return (
    <div className="layout">
      <header className="header">
        <div className="container">
          <div className="header-content">
            <Link to="/" className="logo">
              Clothing Store
            </Link>

            <nav className="nav">
              <ul className="nav-links">
                {navLinks.map((link) => (
                  <li key={link.name}>
                    <Link 
                      to={link.path} 
                      className={location.pathname === link.path ? 'active' : ''}
                    >
                      {link.name}
                    </Link>
                  </li>
                ))}
              </ul>
            </nav>

            <div className="header-actions">
              <form className="search-bar" onSubmit={handleSearch}>
                <input
                  type="text"
                  placeholder="Search products..."
                  value={searchQuery}
                  onChange={(e) => setSearchQuery(e.target.value)}
                />
                <button type="submit">
                  <Search size={18} />
                </button>
              </form>

              <div className="cart-icon">
                <Link to="/cart">
                  <ShoppingBag size={24} />
                  {cartItemsCount > 0 && (
                    <span className="cart-badge">{cartItemsCount}</span>
                  )}
                </Link>
              </div>

              <button className="mobile-menu-toggle" onClick={toggleMobileMenu}>
                {isMobileMenuOpen ? <X size={24} /> : <Menu size={24} />}
              </button>
            </div>
          </div>

          <div className={`mobile-nav ${isMobileMenuOpen ? 'active' : ''}`}>
            <ul className="mobile-nav-links">
              {navLinks.map((link) => (
                <li key={link.name}>
                  <Link 
                    to={link.path} 
                    onClick={() => setIsMobileMenuOpen(false)}
                    className={location.pathname === link.path ? 'active' : ''}
                  >
                    {link.name}
                  </Link>
                </li>
              ))}
            </ul>
          </div>
        </div>
      </header>

      <main className="main-content">
        {children}
      </main>

      <Footer />
    </div>
  );
};

export default Layout;
